<script>
if (!window.DecompressionStream || !window.crypto.subtle) {
    window.onload = () =>
        document.body.innerHTML = "<h2 style='font-family:Arial'>Unsupported browser or insecured connection. (https required)</h2>";
}
else
    (function () {
        const schMode = document.head.querySelector('meta[name="SCH-Mode"]').content;
        async function createCryptoKey(key, keyUsage) {
            const pwdData = schMode.split('-');
            const pwdHashComplexity = pwdData[1];
            let iv = new Uint8Array(atob(pwdData[2]).split('').map(c => c.charCodeAt(0)));

            let hash = new Uint8Array(await window.crypto.subtle.digest("SHA-512", new TextEncoder().encode(key)));
            for (let i = 0; i < pwdHashComplexity; i++) {
                hash[i % hash.length] ^= iv[i % iv.length];
                let buff = new Uint8Array(hash.length * pwdHashComplexity);
                for (let j = 0; j < pwdHashComplexity; j++) {
                    buff.set(hash, j * hash.length);
                }
                hash = new Uint8Array(await window.crypto.subtle.digest("SHA-512", buff));
            }
            const cryptoKey = await window.crypto.subtle.importKey(
                "raw", new Uint8Array(hash.slice(0, 32)), { name: "AES-CBC" }, false, [keyUsage]
            );
            return { cryptoKey, ivPart: iv };
        }
        async function decryptData(data, key) {
            const { cryptoKey, ivPart } = await createCryptoKey(key, "decrypt");
            const decryptedBytes = await window.crypto.subtle.decrypt(
                { name: "AES-CBC", iv: ivPart }, cryptoKey, data
            );
            return decryptedBytes;
        }
        async function loadDict(key) {
            let binData = new Uint8Array(atob(document.getElementById('sch-data').innerHTML.replace(/[\n\r \t]/g, "")).split('').map(c => c.charCodeAt(0)));
            if (key) {
                binData = await decryptData(binData, key);
            }
            const gzip = binData;
            const ds = new DecompressionStream("gzip");
            const blob = new Blob([gzip]);
            const reader = blob.stream().pipeThrough(ds).getReader();
            const data = [];
            while (true) {
                const { done, value } = await reader.read();
                if (done) break;
                data.push(value);
            }
            let uint8Array = new Uint8Array(data.reduce((acc, chunk) => [...acc, ...chunk], []));
            return new TextDecoder().decode(uint8Array);
        }

        async function load(passwd) {
            const schResDict = JSON.parse(await loadDict(passwd));
            document.head.querySelectorAll('meta').forEach(meta => {
                const [type, path] = meta.name.split(':');
                if (type === 'css') {
                    const link = document.createElement('link');
                    link.rel = 'stylesheet';
                    link.href = schResDict[meta.content];
                    document.head.appendChild(link);
                } else if (type === 'js') {
                    window.eval(schResDict[meta.content]);
                }
            });
            if (passwd) return schResDict;
            for (const codeId in schResDict) {
                if (codeId.startsWith('CODE')) {
                    window.eval(schResDict[codeId]);
                }
            }
        }
        async function unlock(passwd) {
            const ui = document.querySelector('.sch-unlock');  
            if (ui.classList.contains('busy')) return;
            ui.classList.add('busy'); 
            try {
                const dict = await load(passwd);
                ui.classList.remove('busy');
                ui.classList.add('fadeout');
                setTimeout(() => {
                    document.body.outerHTML = dict['BODY'];
                    for (const codeId in dict) {
                        if (codeId.startsWith('CODE')) {
                            window.eval(dict[codeId]);
                        }
                    }
                }, 1000);
            }
            catch (error) {
                ui.classList.remove('busy');
                ui.style.animation = "shaking 0.2s ease-in-out 3";
                setTimeout(() => {
                    ui.style.animation = "";
                }, 1000);
            }
        }
        if (!schMode.startsWith('Protected'))
            load();
        else
            window.sch = { unlock };
    })();



</script></head>
